import React , { useState } from 'react';

function App(){
  const styleCss = [];
  function Mclick(){
    styleCss.color = 'green';
    console.log('clicked')
  }
  return(
    <>
    <div>
      <button onClick={Mclick}>Click Me</button>
    </div>
    </>
  )
}

export default App;
